import React from 'react';
import {addMessageActionCreator, updateNewMessageChangeActionCreator} from "../../Redax/Dialogs-reducer";
import Dialogs from "./Dialogs";
import {connect} from "react-redux";
import {withAuthNavigate} from "../../HOC/withAuthNavigate";
import {compose} from "redux";


compose()()


let AuthNavigateComponent = withAuthNavigate(Dialogs);

let mapStateToProps = (state) => {
    return {
        newMessageText: state.dialogsPage.newMessageText,
        dialogs: state.dialogsPage.dialogs,
        messages: state.dialogsPage.messages,
    }
};
let mapDispatchToProps = (dispatch) => {
    return {
        addMessage: () => {
            dispatch(addMessageActionCreator())
        },
        updateNewMessageChange: (text) => {
            let action = updateNewMessageChangeActionCreator(text);
            dispatch(action)
        },
    }
}

const DialogsContainer = connect(mapStateToProps, mapDispatchToProps)(AuthNavigateComponent);

export default DialogsContainer;
